import axios from 'axios'
import TokenService from '@/services/TokenService';


const CAMION_API_BASE_URL = 'http://localhost:8080/api/v1/camiones'

class CamionService{
    getCamiones(){

        const token = TokenService.token_generated;

        // Agregar la cabecera "Authorization" a la solicitud, con el valor "Bearer [TOKEN]"
        const headers = {
            Authorization: `Bearer ${token}`
        };

        return axios.get(CAMION_API_BASE_URL, { headers });

    }
}

export default new CamionService()
